import React from 'react';


var AnnualReport = () => {
    return (
      <div
        style={{
          //display: 'flex',
          justifyContent: 'Left',
          alignItems: 'Left',
          height: '10vh'
        }}
      >
        <h1>Here are some pictures</h1>
        <div>
            <img src="https://picsum.photos/200" alt="" />
        </div>
      </div>
    );
};

export default AnnualReport;
